import React, { useState } from "react";

const OrderContent = ({ orderObject }) => {
  // State
  const [date, setDate] = useState("");

  // Functions
  const dateConverter = () => {
    const convDate = new Date(orderObject.deadline);
    const year = convDate.getFullYear;
    setDate(year);
  };

  return (
    <React.Fragment>
      <div className="accordion-content">
        <ul>
          <li>{orderObject.description}</li>
          <li>{orderObject.quantity}</li>
          <li>{orderObject.deadline}</li>
        </ul>
      </div>
    </React.Fragment>
  );
};

export default OrderContent;
